package com.vueblog.entity;import java.io.Serializable;/* * 版    权:  operate Copyright 2014-2016,All rights reserved * 文 件 名:  WalletBean.java * 描       述:  唯一编号 * 作者:  xiangmiao * 时间:  2020-07-11 11:24:47 星期六 */public class WalletBean implements Serializable{	private static final long serialVersionUID = 5909014685782582984L;	/**	 * 主键	 */	private Long id;	/**	*用户ID	*/	private Long userId;	/**	*金额	*/	private Double money;	/**	*创建时间戳	*/	private Long createTime;	/**	*更新时间戳	*/	private Long updateTime;	/**	*删除标志 0：未删除；1：已删除	*/	private int isDeleted;	public Long getId() {		return id;	}	public void setId(Long id) {		this.id = id;	}	public Long getUserId() {		return userId;	}	public void setUserId(Long userId) {		this.userId = userId;	}	public Double getMoney() {		return money;	}	public void setMoney(Double money) {		this.money = money;	}	public Long getCreateTime() {		return createTime;	}	public void setCreateTime(Long createTime) {		this.createTime = createTime;	}	public Long getUpdateTime() {		return updateTime;	}	public void setUpdateTime(Long updateTime) {		this.updateTime = updateTime;	}	public int getIsDeleted() {		return isDeleted;	}	public void setIsDeleted(int isDeleted) {		this.isDeleted = isDeleted;	}}